import React, { useContext } from "react";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import Navbar from "./components/Navbar";
import { AuthContext } from "./context/AuthContext";
import Home from "./pages/Home";
import About from "./pages/About";
import Collection from "./pages/Collection";
import Login from "./pages/Login";
import Signup from "./pages/Signup";
import Cart from "./pages/Cart"; // Import Cart page
import Checkout from "./pages/Checkout"; // Import Checkout page
import AdminDashboard from "./pages/AdminDashboard"; // Import Admin Dashboard
import ForgotPassword from "./pages/ForgotPassword";
import Success from "./pages/Success"; // Import Success page
import Cancel from "./pages/Cancel"; // Import Cancel page

// Protected Route for authenticated access
const ProtectedRoute = ({ element, role }) => {
  const { user } = useContext(AuthContext);
  if (!user) return <Navigate to="/login" />;
  if (role && user.role !== role) return <Navigate to="/" />;
  return element;
};

const App = () => (
  <Router>
    <Navbar />
    <Routes>
      {/* Public Routes */}
      <Route path="/" element={<Home />} />
      <Route path="/about" element={<About />} />
      <Route path="/collection" element={<Collection />} />
      <Route path="/login" element={<Login />} />
      <Route path="/signup" element={<Signup />} />
      <Route path="/forgot-password" element={<ForgotPassword />} />

      {/* Protected Routes */}
      <Route path="/cart" element={<ProtectedRoute element={<Cart />} />} /> {/* Cart Route */}
      <Route path="/checkout" element={<ProtectedRoute element={<Checkout />} />} /> {/* Checkout Route */}
      <Route path="/success" element={<ProtectedRoute element={<Success />} />} /> {/* Success Route */}
      <Route path="/cancel" element={<ProtectedRoute element={<Cancel />} />} /> {/* Cancel Route */}
      <Route
        path="/admin/dashboard"
        element={<ProtectedRoute element={<AdminDashboard />} role="admin" />}
      />

      {/* 404 Page */}
      <Route path="*" element={<h1>404 - Page Not Found</h1>} />
    </Routes>
  </Router>
);

export default App;
